// import React, { useState, useEffect} from 'react';
// Bootstrap
import { Table } from 'react-bootstrap';
import { Container } from "react-bootstrap";
import {Ingredient} from "../types/types";
import {addIngredient} from "../redux/actions/actions";
import {connect} from "react-redux";

const StateProps = {
    ingredients: Ingredient
}

const DispatchProps = {
    addIngredient: addIngredient
}
const Props = StateProps & DispatchProps;

const ProductsList = ({ingredients, addIngredient}) => {
        return(
            <Container>
                <Table striped bordered hover>
                    <thead>
                        <tr>
                            <th>xd</th>
                            <th>Amount of xyz</th>
                            <th>Delete</th>
                        </tr>
                    </thead>
                    <tbody>
                        if(ingredients[0] != undefined){
                        <tr>
                            <th>{ingredients[0].payload.label}</th>
                            <th>{ingredients[0].payload.unit}</th>
                        </tr>
                        }
                        <tr>
                            <th>empty</th>
                            <th>empty</th>
                            <th>empty</th>
                        </tr>
                    </tbody>
                </Table>
            </Container>

        )
    }

export default connect(
    (state) => ({
        ingredients: state.ingredients.ingredientsList,
    }), {
        addIngredient: addIngredient
    }
)(ProductsList);
